Munbyn Printer is a intellect application that makes printing simple and interesting. It supports the connection with your printer through your mobile phone's Bluetooth or Bluetooth network. Distinguish between life and business mode printing, so that you can quickly find suitable scenarios for operation, and easily make satisfactory labels.
【Edit】
Edit text freely and insert QR code, table, icon, picture, date, batch serial number, etc. The simple editing interface makes the operation more convenient and fast;
【OCR】
Support OCR recognition text fast import editor for printing;
【Document Printing】
It supports importing PDF, TXT, PPT and other electronic documents, and can perform page clipping, one click processing and other operations;
【Enrich Templates】
Built in rich label templates and materials, support one click call and custom modification, and easily edit and print your label works;
【Interesting interaction】
There are unique animated characters and scenes in the application to get more surprises; Life and commercial label printing and sharing make printing more diversified;
【Online feedback】
Support users to feed back product needs online, exchange experience, and obtain technical support, which will help you save a lot of time.




You can use various labels to manage items & merchandtechnicalmaking life & business more clear and orderly. At the same time, it supports you to feedback product requirements online, exchange experience, get fault support, thus saving more time.
